import React from "react";

const BlogList = ({ title, blogs }) => {
  return (
    <div>
      <h1>{title}</h1>
      {blogs.map((index) => (
        <div className="border">
          <div key={index.id} className="blog-preview">
            <h1>{index.title}</h1>
            <p>Written by {index.author}</p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default BlogList;
